                            <div>
                                <div>
                                    <ul>
                                        <li><a href="../index.html">HOME</a></li>
                                        <li><a href="enhance.html">IMAGE ENHANCE</a></li>
                                        <li><a href="previews.html">DETAILED VIEW</a></li>
                                    </ul>
                                </div>
                            </div>
                        </div>
                </div>
            </div>
        </navbar>
    );
};

export default Navbar;
